import {DELETE_TEST, ADD_TEST, INCREASE_USER_SCORE, TEST_VALID} from './actionTypes'

export function deleteTest() {
    return {
        type: DELETE_TEST,
    }
}

export function addTest(test) {
    return {
        type: ADD_TEST,
        test
    }
}
  
export function increaseUserScore(score) {
    return {
        type: INCREASE_USER_SCORE,
        score
    }
}

export function testValid() {
    return {
        type: TEST_VALID,
       
    }
}
  
export function testNotValid() {
    return {
        type: TEST_NOT_VALID,
       
    }
}
